import React from 'react'
import './home.css'

const Home = () => {
  return (
    <section className="home container" id="home">
      <div className="intro">
        <img src='https://images.unsplash.com/photo-1640337516270-1c675eee65f2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80' alt="" className="home__img" />
      </div>
    </section>
  )
}

export default Home
